const ADD_POST = 'ADD-POST';
const UPDATE_NEW_POST_TEXT = 'UPDATE-NEW-POST-TEXT';
const SEND_MESSAGE = 'SEND-MESSAGE';
const UPDATE_NEW_MESSAGE_BODY = 'UPDATE-NEW-MESSAGE-BODY';

let store = {
    _state: {
        profilePage: {
            posts: [
                {id:1, massege:'welcome to the boxing clube', likesCount:31},
                {id:2, massege:"It's my first project", likesCount:13},
                {id:3, massege:"frontend number one!", likesCount:113},
                {id:4, massege:"Yes yes", likesCount:13}
            ],
            newPostText: "Phonk"
        },
        dialogsPage: {
            dialogs: [
                {id:1, name:'Frontend 2.0', img:'data:image/jpeg;base64,'},
                {id:2, name:'Эрбол', img:'data:image/jpeg;base64,'},
                {id:3, name:'Юсуф', img:'data:image/jpeg;base64,'},
                {id:4, name:'Алексей', img:'data:image/jpeg;base64,'},
                {id:5, name:'Белек', img:'data:image/jpeg;base64,'},
                {id:6, name:'rkld_hotboy', img:'data:image/jpeg;base64,'},
                {id:7, name:'*Избранное*', img:'data:image/jpeg;base64,'}
            ],
            messages: [
                {id:1, message:'hi'},
                {id:2, message:'How are you?'},
                {id:3, message:'Bro'}
            ],
            newMessageBody: ''

        }
       
    },
    getState () {
        return this._state
    },
    _callSubscriber () {
        console.log('State changed')
    },
    subscribe (observer) {
        this._callSubscriber = observer;
    },
    dispatch(action){
        if (action.type === ADD_POST){
            let newPost = {
                id: 3,
                name: this._state.profilePage.newPostText,
                age: 17,
                src: 'https://64.media.tumblr.com/f4b778464a57f9080445f30547e38b10/1e569c61da8b911b-c4/s540x810/f89b06211af7f036ab26fd787b50d20d47885d9f.jpg',
                alt: 'piter'
    
            }
            this._callSubscriber(this._state)
            this._state.profilePage.newPostText = ''
            this._state.profilePage.posts.push(newPost)
        }
        else if (action.type === UPDATE_NEW_POST_TEXT){
            this._callSubscriber(this._state)
            this._state.profilePage.newPostText = action.newText
        }
        else if (action.type === UPDATE_NEW_MESSAGE_BODY){
            this._callSubscriber(this._state)
            this._state.dialogsPage.newMessageBody = action.body
        }
        else if (action.type === SEND_MESSAGE){
            let body =  this._state.dialogsPage.newMessageBody
            this._state.dialogsPage.newMessageBody = ''
            this._state.dialogsPage.messages.push({id: 5, message: body})
            this._callSubscriber(this._state)
        }

    }

}

export const addPostActionCreator = () => {
    return{
        type: ADD_POST
    }
}
export const updateNewPostTextActionCreator = (text) => {
    return{
        type: UPDATE_NEW_POST_TEXT,
        newText: text
    }
}
    export const sendMessageCreator = () => {
        return{
            type: SEND_MESSAGE
        }
    }
    export const updateNewMessageBodyCreator = (text) => {
        return{
            type: UPDATE_NEW_MESSAGE_BODY,
            body: text
        }    
}


export default store;
window.state = store;